import React from "react";
import { Button, Container } from "react-bootstrap";

const Admin = () => {
  return (
    <Container className="d-flex flex-column">
      <Button variant="outline-primary" className="mt-3">
        Добавить категорию
      </Button>
      <Button variant="outline-primary" className="mt-3">
        Добавить продукт
      </Button>
      <Button variant="outline-primary" className="mt-3">
        Изменить продукт
      </Button>
      <Button variant="outline-primary" className="mt-3">
        Получить заказы пользователей
      </Button>
    </Container>
  );
};

export default Admin;
